import React, {Component} from 'react';
import Navbar from "../Navbar/Navbar";

class CreateBookmark extends Component {
    // constructor(props) {
    //     super(props);
    //     this.handleSubmit = this.handleSubmit.bind(this);
    // }
    // handleSubmit(event){
    //     event.preventDefault();
    //     const bookmark = {
    //         "name": document.getElementById("name").value,
    //         "rating": 0.0,
    //     };
    //     fetch('/bookmarks/create', {
    //         method: 'post',
    //         headers: {'Content-Type':'application/json'},
    //         body: JSON.stringify(bookmark)
    //     });
    // }

    constructor(){
        super();

        this.state={
            "name":"",
            "rating":0
        }
    }

    onChange(e){
        this.setState()
    }

    render(){
        return(<div>

            <Navbar />
            <div className="container text-center my-5">
                <div className="col-md-4 m-auto">
                    <form className="align-content-center">
                        <div className="form-group">
                            <input type="text"
                                   required="true"
                                   className="form-control"
                                   name="name"
                                   value={this.state.name}
                                   onChange={this.onChange.bind(this)}
                                   aria-describedby="Bookmark Name" placeholder="Bookmark Name"/>
                        </div>
                        <button type="submit" onClick={this.handleSubmit} className="btn btn-warning ">Create</button>
                    </form>
                </div>
            </div>

        </div>)
    }
}
export default CreateBookmark;
